const initState = {
    empID: null,
    adminID: null
}
const initAction = {
    empId : 565
}
const rootReducer = (state=initState, action)=>{
    if (action.empID !== null)
        console.log(action.empID)
    return {
        ...state,
        empID : initAction.empId
    };
}
export default rootReducer;
